import React from 'react'
import './Register.css';




function Register() {
    return (
        <div className="Register__bg">
            <h1>Register</h1>
            <form >
                <label >First name</label>
                <input />
                <label >Last name</label>
                <input />

            </form>
           
        </div>
    )
}

export default Register
